import React from 'react'
import { URL_Image } from '../URL';
import './homecard.css';
import { useHistory, Route, generatePath, Link } from "react-router-dom";

export default function HomecardService({services}) {
    const history = useHistory();
// const updatePath =(cat,sub,service)=>{
// const path=generatePath()
// }
function getRoute(path) {
    let args = Array.prototype.slice.call(arguments, 1);
    let count = -1;
    return path.replace(/:[a-zA-Z?]+/g, function (match) {
        count += 1;
        return args[count] !== undefined ? args[count] : match;
    });
};

    return (
        <>

<div className="home-card">
    <div className="home-card-image-container">
  <img src={URL_Image+services.image} alt="Denim Jeans" className="home-card-image" />

  </div>
  {console.log(services)}

  <div className="home-card-info">

  <Link  className='home-a' to={getRoute(`${services.category.name.replace(/\s+/g, '-')+'/'+services.subcategory.name.replace(/\s+/g, '-')+'/'+services.title.replace(/\s+/g, '-')+'/'+services.id}`)} >
      <p className="home-title">{services.title}</p></Link>
  <p className="home-price"><span className='home-span'>STARTING AT</span> ${services.price}</p>

  </div>
</div>
        </>

    )

}
